import React from 'react';

const Paginate = (props) =>  {
	const paginationNumbers = [];
	for (let i = 1; i <= Math.ceil(props.length / props.ordersPerPage); i++) {
		paginationNumbers.push(i);
	}
	console.log(paginationNumbers.length);
	return (
		<div className='row'>
			<div className='col-md-12' style={{textAlign:'center'}}>
				{props.currentPage != `${1}` &&
				 <button key={0} onClick={()=>props.changePageNo(props.currentPage-1)}>Previous</button>
				}
				{paginationNumbers.map((pageNumber) => (
					<button key={pageNumber} onClick={()=>props.changePageNo(pageNumber)} style={{backgroundColor:props.currentPage == pageNumber? 'wheat':'white'}}>{pageNumber}</button>
				))}
				{paginationNumbers.length != props.currentPage &&
				 <button onClick={()=>props.changePageNo(props.currentPage+1)}>Next</button>
				}
			</div>
	  </div>
	);
}

export default Paginate;
